import React from 'react';
import { Link } from 'react-router-dom';
import { Line } from 'react-chartjs-2';
import {
  Chart as ChartJS,
  CategoryScale,
  LinearScale,
  PointElement,
  LineElement,
  Title,
  Tooltip,
  Legend,
  Filler
} from 'chart.js';

ChartJS.register(
  CategoryScale,
  LinearScale,
  PointElement,
  LineElement,
  Title,
  Tooltip,
  Legend,
  Filler
);

const IndexPage: React.FC = () => {
  // Sample data for the chart
  const chartData = {
    labels: ['Jan', 'Feb', 'Mar', 'Apr', 'May', 'Jun'],
    datasets: [
      {
        label: 'Rainfall Trends',
        data: [65, 59, 80, 81, 56, 55],
        fill: true,
        borderColor: 'rgb(99, 102, 241)',
        backgroundColor: 'rgba(99, 102, 241, 0.1)',
        tension: 0.4,
      },
    ],
  };

  const chartOptions = {
    responsive: true,
    plugins: {
      legend: {
        display: false,
      },
    },
    scales: {
      y: {
        beginAtZero: true,
      },
    },
  };

  return (
    <div className="space-y-6">
      <div className="grid grid-cols-1 md:grid-cols-3 gap-6">
        {/* Statistics Cards */}
        <div className="bg-white rounded-lg shadow p-6">
          <h3 className="text-gray-500 text-sm font-medium">Total Predictions</h3>
          <p className="text-3xl font-bold text-indigo-600 mt-2">158</p>
          <div className="flex items-center mt-4">
            <div className="w-full bg-gray-200 rounded-full h-2">
              <div className="bg-indigo-600 h-2 rounded-full" style={{ width: '70%' }}></div>
            </div>
          </div>
        </div>

        <div className="bg-white rounded-lg shadow p-6">
          <h3 className="text-gray-500 text-sm font-medium">Accuracy Rate</h3>
          <p className="text-3xl font-bold text-indigo-600 mt-2">92%</p>
          <div className="flex items-center mt-4">
            <div className="w-full bg-gray-200 rounded-full h-2">
              <div className="bg-indigo-600 h-2 rounded-full" style={{ width: '92%' }}></div>
            </div>
          </div>
        </div>

        <div className="bg-white rounded-lg shadow p-6">
          <h3 className="text-gray-500 text-sm font-medium">Countries Analyzed</h3>
          <p className="text-3xl font-bold text-indigo-600 mt-2">25</p>
          <div className="flex items-center mt-4">
            <div className="w-full bg-gray-200 rounded-full h-2">
              <div className="bg-indigo-600 h-2 rounded-full" style={{ width: '50%' }}></div>
            </div>
          </div>
        </div>
      </div>

      {/* Chart Section */}
      <div className="bg-white rounded-lg shadow p-6">
        <h2 className="text-lg font-semibold text-gray-800 mb-4">Global Rainfall Trends</h2>
        <div className="h-64">
          <Line data={chartData} options={chartOptions} />
        </div>
      </div>

      {/* Quick Actions */}
      <div className="grid grid-cols-1 md:grid-cols-2 gap-6">
        <Link
          to="/predict"
          className="bg-white rounded-lg shadow p-6 hover:bg-indigo-50 transition duration-200"
        >
          <h3 className="text-lg font-semibold text-indigo-600">Predict Rainfall</h3>
          <p className="text-gray-600 mt-2">
            Get accurate rainfall predictions for any location using our advanced ML model.
          </p>
        </Link>

        <Link
          to="/country-trend"
          className="bg-white rounded-lg shadow p-6 hover:bg-indigo-50 transition duration-200"
        >
          <h3 className="text-lg font-semibold text-indigo-600">View Country Trends</h3>
          <p className="text-gray-600 mt-2">
            Analyze historical rainfall patterns and trends across different countries.
          </p>
        </Link>
      </div>
    </div>
  );
};

export default IndexPage;
